import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='landpage'>
        <div className='search_container'>
          <input type='text' id='search_bar' className='search-box' placeholder='Search'></input>
          <button type='submit' id='search_buton' className='search_button'>GO</button>
        </div>
      </div>
    </div>
  );
}

export default App;
